import React from 'react';

const Home = () => {
  return (
    <div className="home">
      <img src="https://via.placeholder.com/150" alt="Profile" />
      <h2>Nama Anda</h2>
      <p>Deskripsi singkat tentang Anda</p>
    </div>
  );
};

export default Home;
